  false,\n\t\"url\": null,\n\t\"notes\": \"NOAA's Coastal Change Analysis Program
  (C-CAP) produces national standardized land cover and land change information for
  the coastal regions of the U.S. C-CAP products inventory coastal intertidal areas,
  wetlands, and adjacent uplands with the goal of monitoring changes in these habitats
  every five years. NOAA plans to contract out for the development of land cover change
  data based on 2015 and 2016 Landsat satellite imagery (30 meter resolution). It
  is anticipated that contract awards will be made between March of 2016 and August
  of 2019, and that at least 1/5th of the Contiguous United States will be awarded
  each fiscal year, or until a full update has been complete.\",\n\t\"license_title\":
